import { Fragment } from "react";
import classes from "./Cart.module.css";

const Cart = (props) => {
  return (
    <Fragment>
      <li></li>
      <div className={classes["cart-items"]}>
        <span className={classes.total}>Total Amount</span>
        <span>35.68$</span>
      </div>
      <div className={classes.actions}>
        <button>Order</button>
        <button>Close</button>
      </div>
    </Fragment>
  );
};

export default Cart;
